.status-bar {
  font-size: 12px;
  color: rgba(189, 189, 189, 0.65);
  border-top: 1px solid transparent;
  background-color: #2c2c2c;
}
.tab-bar {
  overflow-x: auto;
  overflow-y: hidden;
  border-radius: 0;
  height: 2.5rem;
  max-height: 2.5rem;
}
.tab-bar::-webkit-scrollbar {
  display: none;
}
.tab-bar .tab {
  max-width: 160px;
  height: 2.5rem;
  line-height: 2.5rem;
  padding: 0 10px;
  color: rgba(189, 189, 189, 0.65);
  transition: color 0.1s ease-in;
  font-size: 1em;
  font-weight: 300;
  position: relative;
}
.tab-bar .tab::after {
  content: '';
  position: absolute;
  bottom: 0;
  left: 0;
  width: 100%;
  height: 2px;
  background: #777777;
  transform: scaleX(0);
  will-change: transform;
}
.amu-use-animations .tab-bar .tab::after {
  transition: transform 250ms;
}
.tab-bar .tab.active::after,
.tab-bar .tab.is-focused::after,
.tab-bar .tab:focus::after {
  transform: scaleX(1);
}
.tab-bar .tab .close-icon {
  color: rgba(189, 189, 189, 0.65);
  cursor: pointer;
  line-height: 2.5rem;
  right: 16px;
  text-align: right;
  transform: scale(0);
  will-change: opacity;
  z-index: 3;
}
.tab-bar .tab .close-icon:hover {
  color: inherit;
}
.tab-bar .tab.modified:not(:hover) .close-icon {
  right: 14px;
  top: calc(50% - .135em);
  transform: scale(1);
  width: 8px;
  height: 8px;
  border-color: #777777;
  opacity: 1;
}
.tab-bar .tab.modified:hover .close-icon {
  color: rgba(189, 189, 189, 0.65);
}
.tab-bar .tab.modified:hover .close-icon:hover {
  color: rgba(189, 189, 189, 0.65);
}
.tab-bar .tab .title {
  position: relative;
  z-index: 1;
  margin-top: -5px;
  padding-top: 5px;
  padding-right: 10px;
}
.tab-bar .tab .title.icon::before {
  font-size: 1.25em;
  margin-right: 1em;
}
.tab-bar .tab:hover .close-icon {
  transform: scale(1);
}
.tab-bar .tab[data-type="TreeView"].active::after {
  display: none;
}
.tab-bar .tab.active {
  color: #bdbdbd;
  z-index: 1;
}
.tab-bar .tab.active .close-icon {
  color: rgba(189, 189, 189, 0.65);
}
.tab-bar .tab:hover {
  color: #bdbdbd;
}
.tab-bar .tab.active:hover .close-icon {
  color: rgba(189, 189, 189, 0.65);
}
.tab-bar .tab.active:hover .close-icon:hover {
  color: inherit;
}
