}
.amu-use-animations .amu-tinted-tab-bar .tab-bar .tab.active::after {
  transition: transform 250ms;
}
.amu-tinted-tab-bar .tab-bar .tab.active.active::after,
.amu-tinted-tab-bar .tab-bar .tab.active.is-focused::after,
.amu-tinted-tab-bar .tab-bar .tab.active:focus::after {
